import React, {FC} from "react"
import {TextField, TextFieldProps} from "@material-ui/core"
import {FieldProps} from "formik"


export const CustomField:FC<FieldProps> = (props:TextFieldProps) => {
    return <TextField
        fullWidth
        focused={false}
        variant='outlined'
        {...props}
    />
};
